import React, { useState, useMemo } from 'react';
import { Card } from '@/components/ui/card';
import { Button } from '@/components/ui/button';
import {
  Accordion,
  AccordionContent,
  AccordionItem,
  AccordionTrigger,
} from '@/components/ui/accordion';
import { ArrowLeft } from 'lucide-react';

const EXCLUDED_FIELDS = new Set([
  'formhub/uuid', '_xform_id_string', '_uuid', '_attachments', 
  '_status', '_geolocation', '_tags', '_notes', '_validation_status',
  '_submitted_by', 'start', 'end', '__version__', 'meta/instanceID',
  '_submission_time'
]);

const SurveyResponses = ({ surveys, onBack }) => {
  const [view, setView] = useState('summary');
  const [selectedDate, setSelectedDate] = useState(null);

  const groupedResponses = useMemo(() => {
    return surveys.reduce((acc, survey) => {
      const date = new Date(survey._submission_time).toLocaleDateString();
      (acc[date] = acc[date] || []).push(survey);
      return acc;
    }, {});
  }, [surveys]);

  const renderValue = (value) => {
    if (value == null) return 'No respondido';
    if (typeof value === 'object' && !Array.isArray(value)) {
      return (
        <pre className="bg-white p-2 rounded">
          {JSON.stringify(value, null, 2)}
        </pre>
      );
    }
    return Array.isArray(value) ? value.join(', ') : String(value);
  };

  const BackButton = ({ onClick, text }) => (
    <Button
      variant="ghost"
      className="p-0 hover:bg-transparent"
      onClick={onClick}
    >
      <ArrowLeft className="w-4 h-4 mr-2" />
      {text}
    </Button>
  );

  const SummaryView = () => (
    <Card>
      <div className="flex justify-between items-center p-4 border-b">
        <h5 className="text-lg font-medium">Resumen de Respuestas</h5>
        <span className="bg-primary text-white px-2 py-1 rounded-full text-sm">
          {surveys.length} total
        </span>
      </div>
      <div className="divide-y">
        {Object.entries(groupedResponses).map(([date, responses]) => (
          <div key={date} className="p-4">
            <div className="flex justify-between items-center">
              <div>
                <h6 className="font-medium">{date}</h6>
                <span className="text-sm text-gray-500">
                  {responses.length} respuesta{responses.length !== 1 ? 's' : ''}
                </span>
              </div>
              <Button
                onClick={() => {
                  setView('detail');
                  setSelectedDate(date);
                }}
              >
                Ver respuestas
              </Button>
            </div>
          </div>
        ))}
      </div>
    </Card>
  );

  const DetailView = () => (
    <div className="space-y-4">
      <BackButton 
        onClick={() => {
          setView('summary');
          setSelectedDate(null);
        }}
        text="Volver al resumen"
      />
      
      <div className="flex items-center gap-2">
        <h5 className="text-lg font-medium">Respuestas del {selectedDate}</h5>
        <span className="bg-primary text-white px-2 py-1 rounded-full text-sm">
          {groupedResponses[selectedDate]?.length || 0} respuestas
        </span>
      </div>

      <Accordion type="single" collapsible className="space-y-2">
        {groupedResponses[selectedDate]?.map((response, index) => (
          <AccordionItem key={index} value={index.toString()}>
            <AccordionTrigger className="hover:no-underline">
              <div className="flex justify-between items-center w-full pr-4">
                <span>Respuesta #{index + 1}</span>
                <span className="text-sm text-gray-500">
                  {new Date(response._submission_time).toLocaleTimeString()}
                </span>
              </div>
            </AccordionTrigger>
            <AccordionContent className="bg-gray-50 p-4 rounded">
              {Object.entries(response)
                .filter(([key]) => !EXCLUDED_FIELDS.has(key))
                .map(([key, value]) => (
                  <div key={key} className="mb-4 pb-4 border-b last:border-0">
                    <div className="text-primary font-medium mb-2">
                      {key.startsWith('_') ? key.slice(1) : key}
                    </div>
                    <div className="pl-4">
                      {renderValue(value)}
                    </div>
                  </div>
                ))}
            </AccordionContent>
          </AccordionItem>
        ))}
      </Accordion>
    </div>
  );

  return (
    <div className="container py-4 space-y-4">
      <div>
        <BackButton onClick={onBack} text="Volver a proyectos" />
        <h4 className="text-2xl font-semibold mt-3">Respuestas de la Encuesta</h4>
      </div>
      {view === 'summary' ? <SummaryView /> : <DetailView />}
    </div>
  );
};

export default SurveyResponses;
